values (1050, 1010, -1, -1, null, to_date('20-04-2017 14:20:40', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 14:59:06', 'dd-mm-yyyy hh24:mi:ss'), '170420140841067010133694685279', 130001, '2016/05', '至今', 'Mizani[欧莱雅（中国）有限公司]', null, '化妆品', null, 'Digital Manager', null, 22000, 32, '13薪+浮动奖金', 'GM', '20', '1.Allocate and control digital part budget (including: Brand digital marketing/official website/Tmall);\n2.Lead digital agency to drive digital campaign from ideation to launch, including planning, creative development, H5 page design and user flow, integrated communication plan, campaign performance analytic, campaign budget management;\n3.Maintain relationships with KOLs /beauty expert/bloggers, create a KOL talent pool for brand;\n4.Plan and implement strategies of digital marketing and social media (paid & organic), mobile marketing and owned online channels. (Key social platform: Wechat / Weibo / IN / NICE / live broadcasting);\n5.Lead digital CRM project including: Customer communication, Wechat coupon, mobile banding management/data base segmentation;\n6.Liaise with global team to further develop and plan digital strategies/events for local market.', '分配和控制数字部分的预算，计划和实施数字营销和社交媒体，移动营销和拥有在线渠道@@@50___引领数字化CRM项目包括，为当地市场规划数字战略/活动。@@@50', '法国欧莱雅集团是世界上最大的化妆品公司之一，创办于1907年。欧莱雅集团是美妆品行业中的领导者，经营范围遍及130多个国家和地区，在全球拥有283家分公司、42家工厂、100多个代理商，以及5万多名的员工，是总部设于法国的跨国公司', 0, '221003', '170419134205755010127927081696', 'Alex WANG', to_date('21-04-2017 14:59:06', 'dd-mm-yyyy hh24:mi:ss'), 30, '现在的状态是Open的，自己现在在欧莱雅，Digital这一块晋升比较困难，而且自己的职业目标是奢侈品E-CO或Digital的部分.', '0', 0, null, '完成集团给定Digital 指标100%达成率.', null);
