values (1001, 1001, -1, -1, null, to_date('19-04-2017 14:24:32', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 16:28:10', 'dd-mm-yyyy hh24:mi:ss'), '170419140023739010138848545080', 130001, '2015/08', '2016/02', 'Peuterey (Shanghai) Fashion Trading Co.,Ltd.', null, '休闲', null, 'Store Manager', null, 17500, 26, '12月固定薪水+每月销售提成+年底分红', 'Retail Manager', '8', '1.Opening the new store in Hangzhou Tower, then operating the daily management;\n2.Marketing with VIP & CRM Improvements for this new brand;\n3.Maintain & push the sales to improve store’s revenue for this new store;\n4.Set good relationship with landlord to dig more potential customers.', '店铺日常运营管理@@@30___VIP管理@@@20___全员达成销售目标@@@30___培育潜在客户@@@20', 'Peuterey，著名服装品牌，创立于2002年，名字来源于勃朗峰上的一条山脊，这一条山脊是阿尔卑斯山最令人神往的山道之一。与探索、旅行主题的紧密联系是Peuterey品牌的灵魂，品牌以时尚的方式展现了兼具实用性和多功能性的永恒的休闲时装概念', 0, '221003', '170419134205755010127927081696', 'Alex WANG', to_date('21-04-2017 16:28:10', 'dd-mm-yyyy hh24:mi:ss'), 0, '品牌“水土不服”加上产品本土化不强势，受众群一再缩小，生意持续下降，店铺配置8人，后来节约成本到5人，最后幽默的说把自己“节约”出去了.', '0', 0, null, '达成公司季度、年度销售KPI80%，领先于同体量店铺，全国排名前5,并掌握上海新晋VIP资源.', null);
