values (1002, 1001, -1, -1, null, to_date('19-04-2017 14:24:32', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 16:28:10', 'dd-mm-yyyy hh24:mi:ss'), '170419140023739010138848545080', 130001, '2013/06', '2014/07', 'Balenciaga[百郦嘉贸易（上海）有限公司]', null, '奢侈品', null, 'Store Manager', null, null, null, null, 'Retail Manager', '12', '1.Operational management for two stores in Hangzhou Mix City & Hangzhou Tower;\n2.Marketing with VIP & CRM Improvements;\n3.Maintain & push the sales to improve store’s revenue, about 30% up compared with the same period of last year;\n4.Push the sale level to the top 5 of total stores inside company;\n5.Set good relationship with landlord to dig more potential customers.', '运营杭州万象城和杭州大厦@@@50___管理VIP资源@@@30___培育潜在客户@@@20', '巴黎世家Balenciaga是时尚界最有影响力的品牌之一。1919年由克里斯托瓦尔。巴朗斯加(Cristóbal Balenciaga)成立，1936年落户巴黎，他引领了1930年到1968年之间很多重要的时尚运动。 有代表性的成衣系列体现了品牌的身份，皮具、鞋和饰品等', 0, null, '170419134205755010127927081696', 'Alex WANG', to_date('21-04-2017 16:28:10', 'dd-mm-yyyy hh24:mi:ss'), 0, '品牌风格是一大离职动机，晋升通道的公平性也有待考究，遂离职.', '0', 0, null, '维护并推动销售改善店铺收入，与去年同期相比增长30%，将销售水平推至公司总门店前5名；', null);
