values (1003, 1001, -1, -1, null, to_date('19-04-2017 14:24:32', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 16:28:10', 'dd-mm-yyyy hh24:mi:ss'), '170419140023739010138848545080', 130001, '2010/08', '2013/05', 'Hugo Boss[雨果博斯(上海)商贸有限公司]', null, '奢侈品', null, 'Store Manager', null, null, null, null, 'Retail Manager', '8', '1.Opening the new 400M2 store and daily operational management;\n2.Human Resource Recruitment with Training Achievements;\n3.VM display with brand image maintains;\n4.Stock control, cooperate with merchandise department for positive management;\n5.Analysis the KPI based on weekly/monthly data to push the sales and keep the increasing of revenue;\n6.Marketing with VIP & CRM Improvements;\n7.More than 10 million sales yearly & keeping top 5 sales level in mall.', '店铺运营@@@20___招聘@@@5___陈列@@@20___控制库存@@@20___月度和季度的销售跟进@@@10___管理VIP资源@@@25', 'HUGO BOSS，是世界知名奢侈品牌，源于德国，主营男女服装，香水，手表，及其它配件。', 0, null, '170419134205755010127927081696', 'Alex WANG', to_date('21-04-2017 16:28:10', 'dd-mm-yyyy hh24:mi:ss'), 0, '从运动品牌副店到奢侈品店长这几年历练，品牌积累和沉淀很多，也成长了很多，但一个品牌的惯性思维不是他自己想要的，想尝试更多模式下的集成化管理，遂离职.', '0', 0, null, 'More than 10 million sales yearly & keeping top 5 sales level in mall', null);
