values (1034, 1008, -1, -1, null, to_date('20-04-2017 12:10:07', 'dd-mm-yyyy hh24:mi:ss'), to_date('20-04-2017 13:48:21', 'dd-mm-yyyy hh24:mi:ss'), '170420115513161010195219838274', 130001, '2013/11', '至今', 'American Eagle[美鹰奥菲特（中国）商贸有限公司]', null, '休闲', null, 'Store Manager', null, 17500, 25, '17500*12+COMMISSION3K*12', '区域经理', '15', '1.整体店铺操作，实现的销售目标；\n2.管理，激励和培训工作人员，建立一支专业，高效的团队；\n3.发展策略及店铺日常运营和管理的主动权；\n4.确保提供高水平的客户服务，维护品牌形象店的水平；\n5.以专业的方式处理客户投诉；\n6.控制库存成本，店铺订单；\n7.支持总部及店铺陈列调整；\n8.统筹营销活动，以促进品牌和销售；\n9.确保存储与有关法律，法规的规定； \n10.根据公司营运策略做好直营店的货品订购，库存监管及销售进度的掌控，确保销售计划的完成；\n11.商场市场部保持良好的日常沟通，执行公司相关的营运标准，维护品牌的形象；\n12.对直营店及其店员进行系统的培训，令其达到公司的服务标准。', '人力的招聘、培训、绩效、激励@@@30___库存、客诉、陈列@@@40___直营店全店全力以赴销售@@@30', '美国鹰 (American Eagle)英文简写AE，是美国街头至IN的一个品牌，源于1977年，标志是一只翱翔的鹰，象征坚毅、不屈、拼搏、向上，张扬而不失个性。AE美国鹰 (American Eagle) 创始人 Abraham Bloemaert 为美籍意大利人，幼年成长于美国西部的他，因为家庭因素，举家迁往意大利，从此开始了他的事业。AE美国鹰 (American Eagle) 是美式休闲风格领导品牌，将美式学院传统精神结合最新流行时尚，以合理的价格提供消费者高质感商品服务，深受北美年轻人喜爱，商品包括牛仔系列、户外休闲服、T恤、配饰、鞋靴、泳装系列等。在全美50州有783家、加拿大有71家连锁店。', 0, null, '170419134205755010127927081696', 'Alex WANG', to_date('20-04-2017 13:48:21', 'dd-mm-yyyy hh24:mi:ss'), 0, '晋升渠道受限.', '0', 0, null, '每月100万，每年1500万', null);
insert into B_CANDIDATE_CVWORK (dataid, parentdataid, datasctlevel, datastatus, keyword, istdate, uptdate, c1, c2, c3, c4, c5, c6, c7, c8, c9, c10, c11, c12, c13, c14, c15, c16, c17, c18, c19, c20, c21, c22, c23, c24, c25, c26, c27, c28, c29, c30)
values (1036, 1008, -1, -1, null, to_date('20-04-2017 12:10:07', 'dd-mm-yyyy hh24:mi:ss'), to_date('20-04-2017 13:48:21', 'dd-mm-yyyy hh24:mi:ss'), '170420115513161010195219838274', 130001, '2008/07', '2010/10', '马莎百货', null, '时尚', null, 'Supervisor', null, null, null, null, '店长', '90', '1.整体店铺操作来实现的销售目标；\n2.管理，激励和培训店的工作人员，建立一支专业，高效的团队；\n3.发展策略及店铺日常运营和管理的主动权；\n4.确保提供高水平的客户服务和维护品牌形象店的水平；\n5.专业的方式处理客户投诉；\n6.控制库存成本，包括店铺的订单；\n7.支持总部及店铺陈列调整；\n8.统筹营销活动，以促进品牌和销售；\n9.确保存储与有关法律，法规的规定。', '管理和带动销售@@@40___控制库存@@@30___陈列@@@30', '马莎百货（LSE：MKS,OTCBB：MAKSY）（Marks & Spencer，有时亦标记为M&S、Marks and Sparks、Marks、Marks''s）是一间英国的零售商，总公司位于伦敦，目前在全世界超过30个国家设有约760间分店，包括香港。马莎百货是英国最具代表性的连锁商店之一，至2007年3月为止，在英国境内拥有520间分店，同时也是英国最大的服装零售商，而食品的销售也占了很大的比重。大部分的分店皆以销售服装和食品为主，而马莎百货也开始销售家居用品，例如寝具织品，但销售仍然以前两者为主。', 0, null, '170419134205755010127927081696', 'Alex WANG', to_date('20-04-2017 13:48:21', 'dd-mm-yyyy hh24:mi:ss'), 0, '品牌内部人事调动，自己也想看看新机会', '0', 0, null, '每月1000万，每年1.2亿', null);
