values (1011, 1003, -1, -1, null, to_date('20-04-2017 10:04:18', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 15:45:31', 'dd-mm-yyyy hh24:mi:ss'), '170420093153224010128836026113', 130001, '2015/06', '至今', 'Bally[巴丽（上海）商业有限公司]', null, '时尚', null, 'store manager', null, 23000, 34, '12薪+浮动奖金5k*12个月', '区经', '20', '1.货品的维护和管理，提供feedback 给到商品部，合理有效的安排库存情况；\n2.店内的突发事件的应对以及人员的管理和员工的发展；\n3.确保公司下达的指标每月的完成率以及店的Upt 和Vpt 的达成率；\n4.店铺CRM 的管理和维护，维护老客人发展新客人。', '安排库存、突发处理@@@40___Upt 和Vpt 的达成率@@@30___店铺CRM 的管理理和维护@@@30', '在众多的名牌世家中，BALLY可称是独树一帜的一家。无论是时装、鞋类还是手袋，BALLY始终全心全意去实现一种“整体造型”的设计概念，使其作品散发出魅力十足的气质。', 0, '221003', '170419134205755010127927081696', 'Alex WANG', to_date('21-04-2017 15:45:31', 'dd-mm-yyyy hh24:mi:ss'), 30, '管理两家店，晋升区经没有指标，但是干的是区经的事情.', '0', 0, null, '全国店铺同体量店铺排名前10名，', null);
