values (1012, 1003, -1, -1, null, to_date('20-04-2017 10:04:18', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 15:45:31', 'dd-mm-yyyy hh24:mi:ss'), '170420093153224010128836026113', 130001, '2015/06', '2015/12', 'Miumiu[普拉达时装商业（上海）有限公司]', null, '奢侈品', null, 'Department manager 兼Store manager', null, null, null, null, 'Area manager', '12', '1.确保执行每月公司下达的Target，合理分配每个员工的销售指标并帮助员工完成个人任务，提高vpt 及upt；\n2.提供feedback 给商品部，合理调整店铺的库存状况；\n3.店铺的CRM 的管理细节和发展，帮助店铺员工维护vic 客人；\n4.确保库存的准确性和安全以及安排每日每月的盘点工作。\n5.按照公司标准维护陈列，和vm 沟通根据店铺销售情况调整陈列；\n6.确保店铺的每日正常营运，解决店铺客诉并收集讯息反馈给公司，店铺设施及维护及店铺维修，每日工作安排、每日简短店会、新品的培训和竞争品牌的更新信息，针对每位员工合理分配工作职责并开发员工的职业发展。', '控制库存，管理销售，盘点@@@30___店铺的CRM 的管理理细节和发展，帮助店铺员工维护VIP@@@20___VM@@@30___运营与客诉@@@20', 'Miu Miu（缪缪）率性且充满实验风格，与Prada是同一设计理念的另一种表达方式。Miu Miu 成立于1993年，注重优雅精致且不乏趣味，将女性气质发挥到极致。通过成衣、皮具、眼镜.', 0, null, '170419134205755010127927081696', 'Alex WANG', to_date('21-04-2017 15:45:31', 'dd-mm-yyyy hh24:mi:ss'), 0, '兼SM的工作，但是薪水还是DM level，晋升渠道受限.', '0', 0, null, '达成季度和年度销售指标110%.', null);
