values (1013, 1003, -1, -1, null, to_date('20-04-2017 10:04:18', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 15:45:31', 'dd-mm-yyyy hh24:mi:ss'), '170420093153224010128836026113', 130001, '2010/09', '2014/11', 'Prada[普拉达时装商业（上海）有限公司]', null, '奢侈品', null, '资深销售', null, null, null, null, 'SM', '1', '1.确保每月完成公司下达的指标，积极带领团队完成公司给予的各项指标创造更好的成绩，每月给sa 做新品的Training 并提高sa 的销售技巧，安排部门的每日工作安排。', '销售@@@50___每月给sa 做新品的Training 并提，高sa 的销售技巧，安排部门的每日工作安排。@@@50', '意大利品牌Prada于1913年在米兰创建。Miuccia Prada的独特天赋在于对新创意的不懈追求，融合了对知识的好奇心和文化兴趣，从而开辟了先驱之路。她不仅能够预测时尚趋势，更能够引领时尚潮流。Prada提供男女成衣、皮具、鞋履、眼镜及香水,并提供量身定制服务。', 0, null, '170419134205755010127927081696', 'Alex WANG', to_date('21-04-2017 15:45:31', 'dd-mm-yyyy hh24:mi:ss'), 0, '个人发展', '0', 0, null, '达成季度Senior sales的销售指标', null);
