values (1037, 1008, -1, -1, null, to_date('20-04-2017 12:10:07', 'dd-mm-yyyy hh24:mi:ss'), to_date('20-04-2017 12:10:07', 'dd-mm-yyyy hh24:mi:ss'), '170420115513161010195219838274', 130001, '2000/12', '2008/07', 'Giordano[深圳虎威制衣有限公司]', null, null, null, 'Assistant Store Manager', null, null, null, null, null, null, '1.日常店铺营运管理；\n2.人员管理，包括控制人员流失率，晋升计划及综合考评；\n3.货品管理，包括控制成本毛利，畅销及滞销货品的流通，控制盘点失货，货仓系统管理；\n4.人员培训，针对一线员工从销售人员至店长的系统培训课程，包括销售技巧，服务理念，货品知识，店铺陈列，有效时间管理等有效课程；\n5.店铺陈列，配合VM部门执行各项陈列要求；\n6.商场沟通：包括日常店铺事宜及促销活动；\n7.市场分析，包括对周边品牌的了解及及时反馈整个市场动态；\n8.促销计划，制定有效的促销计划并执行，进行最终评估；\n9.制定及执行新店及闭店的流程。', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('20-04-2017 12:10:07', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
