values (1035, 1008, -1, -1, null, to_date('20-04-2017 12:10:07', 'dd-mm-yyyy hh24:mi:ss'), to_date('20-04-2017 13:48:21', 'dd-mm-yyyy hh24:mi:ss'), '170420115513161010195219838274', 130001, '2011/01', '2013/09', 'Bjorn Borg', null, '运动和户外', null, 'Store Manager', null, null, null, null, '全国销售经理', '12', '1.监督及控制店铺业务运作 ；\n2.负责店铺人事管理（包括工作及排班、督导及培训下属、建立团队）； \n3.带领团队销售产品，并提供优质顾客服务（包括接待顾客、解答顾客查询、处理投诉及提供售后服务等）；\n4.独立操作货品陈列，管理存货（包括盘点、库存控制及订货等）；\n5.整理分析销售资料予有关部门作为拟定市场及销售策略之参考； \n6.与商场沟通，并处理突发事件。', '包括工作及排班、督导及培训下属、建立团队@@@40___顾客接待、客诉处理、督查业务@@@30___控制库存与通达陈列@@@30', '瑞典的设计行业绝对是全球的翘楚，Bjorn Borg则是一个来自瑞典的时尚运动服饰品牌。瑞典球王伯格(Bjorn Borg)是网球名将，因为他拥有辉煌的网球事业，Bjorn Borg是七、八十年代时最具时尚影响力的人物标志。Bjorn Borg作为时尚运动品牌，许多Bjorn Borg的球迷喜欢这个品牌已经远远超过对他网球技术的痴迷。 "Bjorn borg"品牌隶属于瑞典BJORN BORG AB集团，该品牌在欧洲已有5000多家门店。品牌为时尚潮牌，产品风靡欧洲。比勇博格（上海）贸易有限公司为该集团在亚洲的子公司，2012年进入中国，将时尚、性感、运动、玩趣、色彩的元素呈现给亚洲市场。', 0, null, '170419134205755010127927081696', 'Alex WANG', to_date('20-04-2017 13:48:21', 'dd-mm-yyyy hh24:mi:ss'), 0, '品牌在中国的市场低迷，自己也想看看新机会', '0', 0, null, '每月27万', null);
