values (1030, 1007, -1, -1, null, to_date('20-04-2017 11:45:48', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 16:22:15', 'dd-mm-yyyy hh24:mi:ss'), '170420113436661010195299878985', 130001, '2016/04', '至今', 'Richemont[历峰商业有限公司]', null, '奢侈品', null, 'Deputy Digital Director', null, 40000, 55, '13薪+浮动奖金', 'National sales director', '5', '1.Lead creative agency to develop local digital advertising campaign. Manage the campaign project from brief of concept to post buy review;\n2.Establish comprehensive marketing initiatives by cooperating with leading .COM business to boost sales, diversify distribution, limited edition product development, or trendy internet product like live-streaming;\n3.Lead China e-Commerce strategy and build up the business from scratch. Project owner to launch the operation by liaising with both internal function (legal, operation, CC, logistic, IT) and external parties (technical production, wechat development).', 'Deputy Digital management@@@100', '历峰集团（Richemont）是瑞士奢侈品公司，它由南非亿万富翁安顿鲁伯特(Anton Rupert)于1988年建立。公司涉及的四个商业领域是：珠宝、手表、附件以及时装。', 0, '221006', '170419134205755010127927081696', 'Alex WANG', to_date('21-04-2017 16:22:15', 'dd-mm-yyyy hh24:mi:ss'), 30, '公司的管理层变动，与老板的管理风格有点出入，其次如果是在薪资这一块有所调整的话，愿意尝试看下腕表或者时尚的Digital的机会.', '0', 0, null, '完成总部执行Digital目标', null);
