values (10149, 10030, -1, -1, null, to_date('21-04-2017 13:07:59', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 13:07:59', 'dd-mm-yyyy hh24:mi:ss'), '170421124722927010124761484408', 130001, '2013/07', '2015/11', '上海锐力健身装备有限公司', null, null, null, '工程项目管理', null, null, null, null, null, null, '1.管理并监督设计、施工团队的工作进程，与公司及设计公司充分沟理解通设计方案，制定店铺施工计划； \n2.合理安排人员，指导并监督施工现场管理以及商场、消防对接等工作，确保公司所装修的店铺按时保质开出；\n3.审核工程预算，严格控制工程费用，根据工程要求审核店铺施工质量，按时完成工程预算并上报； \n4.监督和指导工程过程中的质量控制和进度控制，对店铺装修工程项目进行总体规划和具体把关，并提供技术支持和突发事件的处理； \n5.店铺装修完成后与品牌公司组织项目竣工的验收及资料归档工作；\n6.公司所有店铺的日常维护管理及形象维护等；\n7.定期组织召开部门会议针对巡店过程中遇到的工程问题进行总结，并逐一进行解决； \n8.协同零售、市场部门针对季节性橱窗陈列调整给予建设性建议。', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 13:07:59', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
