values (10150, 10030, -1, -1, null, to_date('21-04-2017 13:07:59', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 13:07:59', 'dd-mm-yyyy hh24:mi:ss'), '170421124722927010124761484408', 130001, '2009/05', '2013/07', 'Agatha[赛饰贸易（上海）有限公司]', null, null, null, '工程部主管', null, null, null, null, null, null, '1.负责组织全国店铺工程项目管理工作，在公司领导下对项目整体进度、质量、安全等进行预分析、计划与控制； \n2.对供应商、工程队、设备及材料进行市场调研、认证和招标，达到质量可靠，经济合理的目标； \n3.对工程项目合同进行初步编制与审核，论证相关报价及项目时间表，向直属领导和财务部门进行申报与提案； \n4.对所有店铺装修及维护负责，指导项目的实施，监督，跟进完成进度和工程质量，与施工和监理单位保持互动； \n5.与营运、货品、VM部门协调设计工作，协调对应项目场所主管部门及跟进关联的外部工作（消防、空调、保险等）； \n6.对施工现场的技术变更或疑问做出快速反应，必要时做出应急措施并承担结果； \n7.执行公司下达的其它工程项目类工作及相关维护。', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 13:07:59', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
