values (10151, 10030, -1, -1, null, to_date('21-04-2017 13:07:59', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 13:07:59', 'dd-mm-yyyy hh24:mi:ss'), '170421124722927010124761484408', 130001, '2005/07', '2009/04', 'Daphne[达芙妮投资（集团）有限公司]', null, null, null, '空间设计、工程监理', null, null, null, null, null, null, '1.负责所辖区域内的店铺空间规划，按照品牌形象及商场要求设计详细的施工图纸； \n2.店铺装修过程中的监理工作，确保装修符合公司的方案和形象要求，解决现场出现的疑难问题，对装修出现的问题及时寻求解决的办法； \n3.按照店铺装修质量验收标准，在新开店铺施工完毕后现场验收工程质量，完成工程验收报告； \n4.工程图纸资料、完工后现场照片及工程验收报告的整理与归档。', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 13:07:59', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
