values (10153, 10031, -1, -1, null, to_date('21-04-2017 13:11:48', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 13:25:33', 'dd-mm-yyyy hh24:mi:ss'), '170421131148677010154411776126', 130001, '2015/07', '至今', 'Burberry[博柏利(上海)贸易有限公司]', null, null, null, 'ASS SM', null, null, 24, null, null, null, '1.Store operation management: In charge of Shenyang Outlets, all personnel management, sales, and daily operations. Reports directly to the General Manager of the Great District on sales, staffing, stores activities, marketing, competitive brands and etc.\n2.Sales target achievement: Set the daily target according to the sales over the same period and monthly target. Assign to the staff on the specific items. Watch on the progress of target completion and provide timely advices to achieve the target;\n3.Staff training: Spend most of the time on the sales situation of the staff and the response of the customers, timely provide guidance to help the improvement of the staff;\n4.Sales statement analysis: Analyse the daily sales. Analyse the causes for the increase/decrease of the sales weekly according to the sales statements, thus make the action plan;\n5.Follow up with VIC: Watch on the VIC consumption. Regularly communicate with the staff on VIC consumption, revisit frequency, response of the customers to ensure the VIC’s spending amount to achieve the sales goal;\n6.Team management: Identify the strength of different associates and assign work according to improve the store efficiency. Frequently provide guidance on the staff performance, facilitate the staff to develop and improve, thus to form a united and competitive team.', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 13:25:33', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
