values (10160, 10032, -1, -1, null, to_date('21-04-2017 13:41:38', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 13:41:38', 'dd-mm-yyyy hh24:mi:ss'), '170421133004255010179854965390', 130001, '2009/10', '2012/04', 'Lane Crawford[连卡佛百货商贸（上海）有限公司]', null, null, null, '高级销售兼职品牌专员', null, null, null, null, null, null, '1.在设计师品牌区域学到了很多的不同的设计理念，并了解到潮流趋势的发展是变化是多样的；\n2.使自己的潮流触觉更敏锐，做好品牌专员做好品牌报告，及即时的市场反馈情况。', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 13:41:38', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
