values (1074, 1013, -1, -1, null, to_date('20-04-2017 15:20:54', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 17:53:47', 'dd-mm-yyyy hh24:mi:ss'), '170420150057552010141050229478', 130001, '2015/01', '至今', 'Coach[蔻驰贸易（上海）有限公司]', null, '奢侈品', null, 'Senior Manager', null, 50000, 60, '固定12个月薪水+17.8%浮动年终奖金', '总监', '3', '1.Support the merchandising strategy by building assortment for both Full Price and Clearance plan of Handbag Category, which is 60% of total categories’ sales. Make clear assortment statement to show the differentiation of these two business model;\n2.Manage the products investment and follow the complete products lifecycle of entire assortment to achieving all KPI with team member, including sales, margin, WOS, inventory and turn;\n3.Assist in the preparation and delivery of product presentation to field teams. Partner with Visual Merchandising team on monthly floor-sets, product display and window executions to ensure the buying and assortment vision is effectively implemented.', '支持销售策略，为手袋类别的全部价格和清关计划建立分类，这是品类销售的60%。明确分类说明，说明这两种经营模式的区别@@@30___管理产品投资遵循整个分类完整的产品生命周期与团队成员，实现所有的KPI指标包括销售、利润、库存和WOS； @@@20___协助产品的准备和交付给现场团队。与视觉销售团队合作，完成每月楼层设置，产品展示和窗口执行，确保采购和分类的愿景得到有效的执行； @@@15___从事与当地市场需求和趋势的全球营销团队的持续沟通，包括特殊的产品，更为中国新开的商店和新的开始； @@@15___与需求计划紧密合作，提供高级别的性能和库存查看财务和长期，以确保它与公司整体战略。@@@20', '1941年，COACH 诞生于纽约曼哈顿，秉承近75年来精湛手工工艺及独具匠心的创造力，融合美国悠久文化与历史，致力于打造纽约现代奢华风尚。2017 全新Coach 1941 春季时尚系列发布，结合边穗,钉饰和朋克等纽约嬉皮元素，精选手袋、钱包、服饰、鞋履， 让春天个性飞扬。', 0, '221004', '170419134205755010127927081696', 'Alex WANG', to_date('21-04-2017 17:53:47', 'dd-mm-yyyy hh24:mi:ss'), 30, '公司目前总监级别人选该升的不升，自己作为后备候选人，可能是高层 变动，现在Open看下总监的机会.', '0', 0, null, '实现中国区管理产品投资遵循整个分类完整的产品生命周期与团队成员，实现所有的KPI指标包括销售、利润、库存和WOS标准化，；', null);
