values (1076, 1013, -1, -1, null, to_date('20-04-2017 15:20:54', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 17:53:47', 'dd-mm-yyyy hh24:mi:ss'), '170420150057552010141050229478', 130001, '2009/06', '2012/01', 'Nike[耐克体育（中国）有限公司]', null, '运动和户外', null, 'Planning & Allocation Manager', null, null, null, null, '总监', '5', '1.3 functions covered: Planning, Allocation and Order Management, all in charge of Greater China (Mainland/HK/TW). Work with team members to maximize the store revenue. Centralized working process for the Mainland/HK/TW;\n2.Planning: \na.Work with Finance and Categories to provide annual financial plans. Create Seasonal buying plan top-down for each store and GC total. Full year revenue target forecast. Yearly markdown and category plan strategy setting. By quarter/ month rolling forecast base on review. And provide suggestion to catch the whole year target. Developed the cadence of markdowns to effectively manage inventory and stray aligned with Gross Margin yearly goal;\nb.Provide yearly/monthly/weekly by category by store sales analysis report;\n3.Allocation:\na.In charge of inventory management for both store level and DC level. Ensure in-season store replenishment is allocated capitalizing on maximizing business and sell-thru.', '3功能包括：规划、配置和订单管理，都在大中国的电荷（大陆/ HK / TW）。与团队成员合作，最大化店铺收入。内地/香港/台湾的集中工作程序；@@@50___在库存管理负责存储级和DC级。确保在季节性商店补货分配资本化最大化业务和销售通过。平衡库存管理。根据核心分类和季节性举措确定每个店铺的关键项目。@@@50', null, 0, null, '170419134205755010127927081696', 'Alex WANG', to_date('21-04-2017 17:53:47', 'dd-mm-yyyy hh24:mi:ss'), 0, '想要去奢侈品做Panning，因为自己觉得前几段在零售、化妆品包括快消都有涉猎.', '0', 0, null, '与金融类提供年度财务计划。创建季节性采购计划自上而下每个商店和GC总。全年收益目标预测。每年的降价和品类计划策略设置。按季度/月滚动预测的基础上审查。并提出了全年目标的建议。开发了降价促销的有效管理库存和杂毛利率的年度目标，提供年度/月度/每周由商店销售分析类报表；', null);
