values (10163, 10033, -1, -1, null, to_date('21-04-2017 13:42:55', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 14:16:52', 'dd-mm-yyyy hh24:mi:ss'), '170421134255520010191687147643', 130001, '2014/07', '至今', 'BV[柏蒂.温妮达（中国）贸易有限公司]', null, '奢侈品', null, 'Assistant Store Manager - IFC', null, 24500, 40, '13个月固定薪水，每月2-3K提成，加年终奖', '店长', '6', '1. Deal with the daily management in boutique. Solve the problems and give a quick reaction while emergency happen in boutique;\n2. Assisting the merchandising;\n3. Communicate between group members to build up strong working relationship and pleasurable but effective environment;\n4. Analyze monthly and yearly sales data and finish different reports;\n5. Arrange reasonably the works to staff and discover their potential. Lead the team to achieve different targets;\n6. Provide different training to the staff after learning and comprehending of new information, such as product knowledge, selling technique, brand culture, admin skill etc.;\n7. Manage the stock amount and reorder the products in time. Also keep the warehouse clear and rationally use the space;\n8. Present products in store and make it contribute to sales;\n9. Take in charge with CRM dpt. Liaise customers, quoting for existing customers and follow up;\n10. Sale’s target: Reach my individual monthly target, and set up staffs target in monthly;\n11. VIP service: develop and maintain VIP;\n12. Analyze monthly marketing database and report to the Store manager;\n13. Stock management; organize staff finish monthly stock check, and sold product report;\n14. Daily operation: associate Store manager for assigning the tasks;\n15. Team management, build up team-work spirit, encourage each team member, share new product information to the staffs in time;\n16. Merchandising: organize each department display, check the whole shop visual effect;\n17. Commissioner of the Make to Measure, have been invited to France for training. Now taking charge in Southern China. Make the personal measurement for VIP customer for their dress, place order and report to France.', '库存管理@@@20___销售及服务@@@50___CRM@@@20___人员管理@@@10', 'Bottega Veneta自1966年始，汇集意大利出色传统皮革工匠，以上等的材质、卓越的手工艺、现代的功能，以及创新的设计为宗旨，秉承瑰丽细致、注重美感和秉具个人风格的一贯特质。匠心呈现男士系列、女士系列、家居艺术及香氛系列等。', 0, '221003', '170419134656067010114745958955', 'Steven ZHOU', to_date('21-04-2017 14:16:52', 'dd-mm-yyyy hh24:mi:ss'), 30, '内部看不到晋升空间。', '0', 0, null, '业绩一直排名前列。', null);
