values (10180, 10038, -1, -1, null, to_date('21-04-2017 14:39:49', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 14:51:44', 'dd-mm-yyyy hh24:mi:ss'), '170421143949708010161149322960', 130001, '2014/08', '至今', 'Berluti[伯尔鲁帝（上海）商贸有限公司]', null, null, null, 'Assistant Store Manager', null, null, 21, null, null, null, '1.16年YTD同比15YTD增长6%，Berluti在天津市场入驻已有5-6年的时间，品牌在市场的发展已到了瓶颈期在加之友谊商厦配套设施的老化和商场规划的不完善，给我在招募新客人和维护老客人带来了很大的困难和阻力。本人首先着重维护老客人来稳定品牌销售日益下降的局面，并应用品牌独有的售后转色服务来吸引和培养新客人，来达到良性的新老客人回店率并带来销售即完成销售目标；\n2.15年神秘访客成绩在全国第二名980分，随着大力度的政府反腐政策和经济趋势的不稳定，导致近几年奢侈品行业的销售业绩很大波动，我们更要注重如何完善销售流程和提高服务质量来提高客人来店时，有更加轻松愉悦的氛围与我们沟通并产生销售以及大单销售；\n3.库房及盘存管理，15年、16年天津店铺是在公司财务部门公认的货品管理上作为优秀的店铺，这也是本人最为关注的一方面，库存优化、畅销货品库存量及合理摆放、新品到店的周期和VM陈列都是与提高销售额有至关重要的因素；\n4.培训及完善售后服务，天津店铺没有转色师不能及时提供客人需求货品的问题，本人主动向公司申请学习Patina技术，弥补了补色和简易的转色欠缺的问题，提高了客人对店铺服务上的满意度促进客人在次回店消费；\n5.同时在店铺员工销售服务流程、产品知识的培训和潜力发掘上也做了很多工作，为提高店铺在Bespoke和Special orders业绩上的贡献，制定了培训计划让店铺负责定制工作的同事进行深入培训，让店铺全部同事充分了解整个定制的流程并可以独立操作系统下单，提高了我们在高级定制方面给营业额的份额。', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 14:51:44', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
