values (10189, 10037, -1, -1, null, to_date('21-04-2017 15:24:34', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 16:11:02', 'dd-mm-yyyy hh24:mi:ss'), '170421143322192010176874685448', 130004, '2015/03', '2016/01', 'Ralph Lauren[拉尔夫劳伦贸易(上海)有限公司]', null, null, null, 'Area Manager - North China, Chengdu, Chongqing', null, null, null, null, null, null, '1. Managed 11 stores, including 2 Ralph Lauren luxury stores (Shenyang, Changchun), 8 kids stores (Beijing, Changchun, Dalian, Shenyang, Chengdu, Chongqing), and 1 golf store (Beijing). Led a team of 7 managers as direct reports;\n2. Grew comp store business to double to triple digit in selected stores: 31% growth in golf store, 200% in Chengdu, 9% in Beijing SKP, 2% in Beijing Scitech;\n3. Concurrently led zone wide POS system upgrade project and worked cross function with APAC and China functional teams;\n4. Concurrently led China zone CRM. Developed and implemented successful CRM campaigns focusing on customer acquisition to VIC growth and retention for all channels (luxury, kids, outlet), including China zone''s first loyal and "At-Risk" customer programs, and VICs for outlet channel. Resulted in successful overall VICs customers: luxury +45%, kids +102%, increased overall VIC sales by +28% and existing VIC sales contribution from 21% to 28%;\n5. Spearheaded successful customer data capture campaigns for China zone and achieved highest growth rate in APAC for both customer associated transactions +32%, and valid customer rate +23%. Ranked overall number 3 in APAC, up from number 6;\n6. Involved in service/ mystery shopper committee. Implemented key programs for successful growth in mystery shopper scores. Increase in 21 basis points for luxury and kids stores on average, with 2 stores ranked highest in APAC;\n7. Launched monthly multiple zone wide incentive plans for both luxury and kids channel that saw monthly increase and sell through in category and overall sales in both kids and luxury channels;\n8. Managed and partnered with cross functional team and landlords on 2 successful store openings: Changchun (luxury and kids).', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 15:24:34', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
