values (10181, 10038, -1, -1, null, to_date('21-04-2017 14:51:26', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 14:51:44', 'dd-mm-yyyy hh24:mi:ss'), '170421143949708010161149322960', 130001, '2010/09', '2014/07', 'BV[柏蒂.温妮达（中国）贸易有限公司]', null, null, null, 'Supervisor店铺主管', null, null, null, null, null, null, '1.在Bottega Veneta以工作了将近4年的时间，先后亲身经历了三家店铺的开业筹备及日常营运等相关工作，培训员工行政工作（货品客修店修、CRM客户管理、库房管理、货品盘点及差异调整、转货流程、排班及工时汇总），监督日常销售指标完成情况及班次人员安排，客诉处理，店铺视觉陈列及顾客资料管理及顾客维护等工作；\n2.2010年入职时以Sales的身份独立带班安排每日销售任务的分配、日常货品清点、维护视觉陈列、每日销售报告等工作，一年后能独立安排日常工作的同时销售业绩突出为年度销售第二名的成绩晋升为Senior sales，在北京新光店铺人员紧张的时期去支援3个月；\n3.2012年9月天津第二间店铺佛罗伦萨小镇开业，应公司要求调店协助开店并安排店内所有事宜，因当时店内最高职位是新招聘的supervisor缺少对团队的管理经验，本人可直接将工作汇报与区域经理；\n4.2013得到公司对本人工作的认可并协助新任店铺经理在销售业绩有突出表现的情况下，升职为supervisor；\n5.2013年6月天津银河国际第三间店铺开业，应公司要求调店协调和筹备开店等工作，在没有招聘到店经理的时期暂由本人负责这家店铺所有事宜，向区域经理汇报每月的销售月报、竞争品牌报告、月度盘点及差异调整报告、店铺销售人员排名分析，监督核查每月的人事工时汇总、店铺备用金申请及CRM新客人资料月度收集率汇总的完成情况；\n6.在这将近4年的工作中，本人多次去外地支援开店，兼任店铺员工代表一职与HR部门沟通传达最新的政策和福利待遇，了解Bottega Veneta的公司营运制度人事条例，可独立完成所有的行政工作。', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 14:51:44', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
