values (10188, 10040, -1, -1, null, to_date('21-04-2017 15:18:21', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 15:30:47', 'dd-mm-yyyy hh24:mi:ss'), '170421151821302010135595896463', 130001, '2016/03', '2016/04', 'Dunhill[阿尔弗雷德登喜路（上海）贸易有限公司]', null, null, null, '店铺经理', null, null, 20, null, null, null, '1.负责带领团队完成公司下达每月任务指标；\n2.店内货品管理：保证盘点数据无差异，进行货品补货申请的跟进；\n3.店员管理：保证员工符合品牌形象要求以及仪容仪表规范、员工考勤统计、制定班表。凝聚团队作用，针对产品以及服务进行培训和考核；\n4.店内陈列：根据公司指引进行陈列工作督促检查，并根据销售情况定期调整店面陈列；\n5.负责定期完成公司所需各项数据的收集、统计、制表、分析等工作；\n6.店内VIP顾客管理：将顾客资料登记、分类、汇总、制表.重点VIP顾客维护工作；\n7.负责与商场沟通联络工作。维系公司于商场的良好合作关系；\n8.负责提出合理化可行性促销方案，进行联络执行。', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 15:30:47', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
