values (10261, 10053, -1, -1, null, to_date('21-04-2017 18:03:56', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 18:15:25', 'dd-mm-yyyy hh24:mi:ss'), '170421180356458010173272971448', 130001, '2017-01-01', '至今', 'Richemont[历峰商业有限公司]', null, null, null, 'Senior Trainer', null, null, 29, null, null, null, '1.Be responsible for training in all over China:\na.Orientation training: provide brand history, culture, professional product knowledge and selling skills, in order to have industry and specialized knowledge, as well familiarity for Piaget;\nb.Boutique coach: specialized guidance for service standard, selling skills, and product knowledge, promote sales performance;\nc.Preparation of material for training. On the basis of material from HQ, and localized, make new product training material, make sure information transfer in order;\nd.In charge of entirely training for Retail & Wholesale, tailor made different stage training needs, arrange annual training program, make sure synchronize with internal boutique;\ne.Training sharing topic for each month by monthly report, help to review product knowledge, selling speech and market trend;\nf.Setup whole year training plan and budget, in accordance with requirement of retail and wholesale, setup arrangement for the year round;\n2.Watch specialist project:\na.Tailor made specific training course for this project, find what they need in different stage in knowledge and sales. Make sure they are the professional people in the boutique;\nb.Follow up and help their development, pay close attention to each training result, and set follow up plan, make sure it has a good training effect;\nc.Lead to participate in watch & wonders in Hong Kong every year, help to understand the market trend and competitor new products. And help them to sharing with other colleague.', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 18:15:25', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
