values (10279, 10055, -1, -1, null, to_date('21-04-2017 18:43:30', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 18:43:30', 'dd-mm-yyyy hh24:mi:ss'), '170421183517817010120917660967', 130001, '2013/04', '2016/12', 'Fendi[芬迪(上海)商业有限公司]', null, null, null, '店经理', null, null, null, null, null, null, '1.2013年4月起至2014年底在杭州万象城工作；自2015年起调任杭州大厦芬f店铺；\n2.日常需要负责店铺正常运营，维持公司运营标准；\n3.在2014年及2015年两次以100%达标率通过公司top store 项目的考核；\n4.同时还需要达成公司下达的销售指标。自2013年起，平均每年的同比销售增长在30%以上。2014年底更获得全国最佳销售业绩增长比店铺奖；\n5.日常还负责招聘和培训员工，入职以来内部提升1名ASM，1名SSA；也培养了多名员工成长为资深的一线销售能手。', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 18:43:30', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
