values (10281, 10055, -1, -1, null, to_date('21-04-2017 18:43:30', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 18:43:30', 'dd-mm-yyyy hh24:mi:ss'), '170421183517817010120917660967', 130001, '2009/06', '2011/12', 'Sephora[丝芙兰（上海）化妆品销售有限公司]', null, null, null, '店长', null, null, null, null, null, null, '1.副店入职，7个月后升为店长。先后工作过3家店铺。开解百、印象城2家新店；\n2.日常工作需严格按照公司运营标准，维护门店正常有序运营；\n3.细化分解销售指标至月、日并全力达成；\n4.实时关注产品库存，实现销售率最大化并降低损耗；\n5.保证店铺陈列水准，优化陈列，突出新品和热卖货品。负责员工从招聘到培训上岗的一系列培训教育工作；\n6.树立团队意识，通过团队建设或激励竞赛等方法激发员工工作热情和积极性。', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 18:43:30', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
