values (10282, 10055, -1, -1, null, to_date('21-04-2017 18:43:30', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 18:43:30', 'dd-mm-yyyy hh24:mi:ss'), '170421183517817010120917660967', 130001, '2007/06', '2009/05', 'Decathlon[迪卡侬（上海）体育用品有限公司]', null, null, null, '部门经理/拓展经理', null, null, null, null, null, null, '1.入职时负责商场内最大部门（登山部门：销售面积约600平方）的管理工作，日常工作包括对部门内的人员招聘、培训和日常管理，协调好高峰期间FT及PT员工的调配；\n2.负责部门内一年两次大规模的货架调整（包括前期的准备和中期的执行以及后期的完善）和日常需要的货架完善和细节维护；\n3.实时掌握部门内商品在季初季末的不同备货和销售状况，关注库存并控制产品损耗。积极组织销售工作，及时安排促销和清货工作；\n4.工作一年后转为杭州地区的新门店拓展经理，具体包括深入了解和分析当地市场，确定未来门店布局；\n5.与政府、开发商及相关零售拓展经理沟通合作，选择合适点位及开发方式；\n6.和公司市场、工程、法律、财务等各部门合作，确立新开店各项相关事务。', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 18:43:30', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
