values (10284, 10056, -1, -1, null, to_date('21-04-2017 18:54:32', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 18:54:32', 'dd-mm-yyyy hh24:mi:ss'), '170421184003349010173028776870', 130001, '2015/07', '2016/08', 'Puma[彪马（上海）商贸有限公司]', null, null, null, 'E-com Operation Manager', null, null, null, null, null, null, '1. Manage the daily operations of E-commerce under the fast growing E-commerce dept with close work relationship with all key functions in the organization as well as external vendors (warehouse, marketplaces, call center, etc.);\n2. Planning and Financial modeling C work together with head of E-commerce and prepare monthly E-com P&L and provisions, budgeting, P&L projection based on different contract terms. Support contract term negotiation with existing/new vendors & liaise with stakeholders legal, finance, logistics etc.);\n3. Manage weekly forecast v.s. actual, and evaluate campaigns impact from various marketplaces and make sure monthly sale target is achieved;\n4. E-commerce Operations management - Conduct Standard Operating Procedures Review. Ensure back-end operations work smoothly at all steps, i.e. IT/ Logistics, warehouse, call center and etc, inclusive internal communication across departments and external communication with TP. Improve processes if needed;\n5. Business Development C Lead sustainable growth of the current businesses following strategy set by the Head of Ecommerce by overseeing campaigns strategy;\n6. Work closely with content management /ecom buying functions to ensure perfect execution of such campaigns as NPL, 618, 626, 11.11 and etc. Report on relevant KPIs especially net sales & sell thru;\n7. Vendor& marketplaces management - Work together with Head of E-commerce for store management for Tmall, JD and future business, especially support TP for their requirements; and also join meetings/seminars from marketplaces and maintain a good relation with marketplace.', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 18:54:32', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
