values (10286, 10056, -1, -1, null, to_date('21-04-2017 18:54:32', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 18:54:32', 'dd-mm-yyyy hh24:mi:ss'), '170421184003349010173028776870', 130001, '2011/10', '2014/04', 'Shanghai BaoZun & Shanghai Innshine', null, null, null, 'Sales Director', null, null, null, null, null, null, '1. 2011/10 - 2013/5: Shanghai Baozun E-Commerce Inc. (1000-5000 people);\n2. 2013/5 - 2014/4: Shanghai innshine E-Commerce Inc. (200-500 people);\n3. Gain a deep understanding of products, explore core selling points of products, formulate different marketing strategies for different products and seek for added value to increase customers’ buying inclination;\n4. Fully responsible for sales and management of the Taobao online shop and completing sales missions assigned by the shop; \n5. Supervise and provide relevant data every day, such as marketing data, transaction data, commodity management and customer management data, etc.; \n6. Generally plan the TMALL shop, skillfully apply internal popularizing tools of Taobao to effective network popularizing and improve the exposure rate, click rate, page view and take rate;\n7. Regularly track and assess popularization effect and promptly propose measures for marketing improvement and practicable and feasible improvement plans; \n8. Arrange various sales promotion activities and planning of the shop; \n9. Train and manage team members and formulate Key Performance Indicator (KPI);\n10. Communicate with TMALL of Taobao to obtain customer flow resources.', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 18:54:32', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
