nd VIP visit duration increase from below 1 min to 8-10 min according to the data from GA;\n9. The second purchase rate of newly-registered VIP increased from below 10% to around 40% within three months;\n10. Monthly increase rate of sales volume remained around 10%;\n11. Increase rate of new VIP remained 100%;\n12. Established a team for Marketing Dept.', null, null, 0, null, '20161101000000999000000001', '白子牙', 
        to_date('21-04-2017 18:54:32', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
