        '1. In charge of the daily operation of store or stores;\n2. Take responsibility for store staff learning and development;\n3. Manage the development of all members of the team, to enable them to fulfill both their current role and future potential;\n4. Apply performance management processes, (observations, discussions, actions, review), to improve team performance where necessary; \n5. Identify training needs, and ensure all training initiatives are successfully implemented; \n6. Demonstrate behaviors consistent with delivering the promises at all times, leading the store team by your own example in delivering great customer service; \n7. Through effective stock level management, labor scheduling, training, and reward and recognition, capture every sales opportunity; \n8. Have overall responsibility for all processes in store providing consistent brand standards; \n9. Monitor and take action where necessary on all aspects of brand standards, health and safety and product safety; \n10. Communicate clearly, courteously and effectively with all the team so that all targets are understood; \n11. Communicate clearly, courteously and effectively with all customers, resolving all concerns and questions satisfactorily; \n12. Openly recognize great customer service; \n13. Be aware of and be able to respond to all activity in the local marketplace including outdoor marketing & directing marketing initiation action; \n14. Be accountable for the effective management of the profit and loss statement, maximizing store sales and profit; \n15. Manage the security and integrity of cash, stock, premises and personnel through vigilant observation and careful use of keys and appropriate personnel; \n16. Ensure all documentation is kept accurately, neatly and confidentially; \n17. Ensure that all reporting is completed accurately and on time; \n18. Attend and hold company training sessions and meetings when required; \n19. Ensure that the cascade of information to all members of the store team is timely, accurate and uses all company systems; \n20. Ensure compliance with all aspects of the health & safety, and product safety policies; \n21. Ensure compliance with all aspects of the company’s audit and operating procedures; \n22. Be accountable for all financial anomalies recorded during your period of responsibility, reporting such anomalies to your line manager;\n23. Follow superior’s instruction for any new assignment/projects.', 
        null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 17:11:57', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
