values (10294, 10058, -1, -1, null, to_date('21-04-2017 21:39:00', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 21:59:40', 'dd-mm-yyyy hh24:mi:ss'), '170421213900645010180535485136', 130001, '2012/09', '至今', 'Crocs[卡骆驰鞋饰（上海）有限公司]', null, null, null, 'Senior Merchandising Manager', null, null, 52, null, null, null, '1. Merchandising Strategy & Assortment Planning:\na) Drive and communicate merchandising strategies and business opportunities in DTC channel;\nb) Review and set OTB budget and merchandise the assigned lines to hit seasonal target margin/revenue plan as determined by GM;\nc) Standardization of lifecycle planning, assist in setting and implementing lifecycle strategies with the Regional Merchandising Director;\nd) Focus on the consumer, brand vision and business needs to build and drive retail key seasonal brand and product stories;\ne) Responsible for setting & tracking the financial plan (Sales $, Units, GM%, ASP, Stock Turn) at gender / silhouette level for total retail;\nf) Providing overall direction to VM on space allocation in store;\ng) Monitor sell-through and make relevant suggestions on replenishments or stock movements throughout retail stores;\n\n2. Market Analysis & Reporting:\na) Generate weekly and monthly reports on sales and product KPIs and analyze results;\nb) Determine impact of promotional activity on sales and adjust forecast for related items;\nc) Monitor new products sales performance and highlight key issues to product team;\nd) Market / store visits as required to better understand respective market / store needs and evolution.\n\n3. Staff Management:\na) Lead and manage the Merchandising Team to coordinate and execute merchandise planning;\nb) Develop and implement strategic plans and performance targets for subordinates;\nc) Build strong cross functional relationships within the organization.', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 21:59:40', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
