values (10302, 10059, -1, -1, null, to_date('21-04-2017 22:29:42', 'dd-mm-yyyy hh24:mi:ss'), to_date('21-04-2017 22:29:42', 'dd-mm-yyyy hh24:mi:ss'), '170421221601161010191108030843', 130001, '2010/04', '2010/09', '史尊臣（上海）商贸有限公司', null, null, null, '销售及营运经理', null, null, null, null, null, null, '1. 负责公司三个品牌所有的营运及销售管理工作！其中公司内部除营运部门外，另分管IT部、视觉陈列部、客服部门的管理工作。\n2. 依据公司的发展及年度目标考核要求，制定各区域季度指标达成方案，将各项工作细分到每月、周、天，管理各地区域主管和公司的重点目标销售店铺，全国在北京、上海、西安、哈尔滨、成都、武汉、长沙、无锡、苏州、乌鲁木齐等城市的一线商场拥有30家直营店铺、6家分销商店铺和8家托管店铺。与各商场营运负责人沟通顺畅，积极配合和跟进店铺业绩情况，争取商场排名前茅。\n3. 参与所有品牌德国总部的每季货品订货和新品发布会，充分了解各品牌文化、每季货品潮流趋势及系列特色等专业知识，制定新品培训方案，并给予货品部全国市场销售情况分析，以全面提供更为适合各地市场的货品建议，对于未来的销售做好各项准备工作。曾参与多次瑞士、德国及意大利品牌公司新品订货工作及时装新品发布会。', null, null, 0, null, '20161101000000999000000001', '白子牙', to_date('21-04-2017 22:29:42', 'dd-mm-yyyy hh24:mi:ss'), 0, null, '0', 0, null, null, null);
